export default {
  components: {
    Crumbs,
    Summa,
    List
  },
  computed: {
    canOrder: function () {
      return this.list.filter(item => item.photos.length).length;
    }
  },

  async asyncData(ctx) {
    let {
      keyword,
      type
    } = ctx.query;
    let {
      status,
      data: {
        product,
        more: list,
        login
      }
    } = await ctx.$axios.get('/search/products', {
      params: {
        keyword,
        type,
        city: ctx.store.state.geo.position.city
      }
    });

    if (status === 200) {
      return {
        keyword,
        product,
        type,
        list,
        login
      };
    } else {
      return {
        keyword,
        product: {},
        type,
        list: [],
        login: false
      };
    }
  }

};

